import * as React from 'react';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import Divider from '@mui/material/Divider';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';
import PropTypes from 'prop-types';
import DialogTitle from '@mui/material/DialogTitle';
import Dialog from '@mui/material/Dialog';
import PersonIcon from '@mui/icons-material/Person';
import AddIcon from '@mui/icons-material/Add';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';

export default function SimpleDialog(props) {
    const handleClose = () => {
        props.onClose();
    };

    return (
        <Dialog onClose={handleClose} open={props.open}>
            <Box sx={{ flexGrow: 1 }}>
				<Grid container spacing={1}>
                    <Grid item xs={12}>
                        <DialogTitle>Informações Pessoais do Servidor</DialogTitle>
                    </Grid>
                    <List>
                        <Grid item xs={8}>
                            <Avatar alt={props.item.name} src={`https://www.inf.ufpr.br/hvehrenfried/Treinamento/Dados/photo/${props.item['photo file']}`} />
                            <ListItemText primary={props.item.name + " " + props.item.surname} />
                        </Grid>
                        <Grid item xs={4}>
                            <ListItem>
                                <ListItemText primary={props.item.phone} />
                            </ListItem>
                        </Grid>
                        <Grid item xs={4}>
                        <ListItem autoFocus>
                            <ListItemAvatar>
                                <Avatar>
                                <AddIcon />
                                </Avatar>
                            </ListItemAvatar>
                            <ListItemText primary="Add account" />
                        </ListItem>
                        </Grid>
                    </List>
				</Grid>
			</Box>
        </Dialog>
    );
}
